script: |
  super -f text -I q8732.spq | sort > q8732.out

inputs:
  - name: q8732.spq
    data: |
      SELECT - 44 * - col0, col0 FROM tab0 (FORMAT parquet) WHERE NULL BETWEEN - CAST ( 32 AS INTEGER ) * + col1 + - + col2 * - CAST ( - - CAST ( NULL AS INTEGER ) AS INTEGER ) AND NULL;
  - name: tab0

outputs:
  - name: q8732.out
    data: |
